import React from 'react';
import './MyBookingSidebar.css';

const MyBookingSidebar = ({ cartItems, onRemoveItem, onCheckout }) => {
    return (
        <div className="my-booking-sidebar">
            <h3>My Booking</h3>
            {cartItems.length === 0 ? (
                <p>Your booking cart is empty.</p>
            ) : (
                <div>
                    {cartItems.map((item, index) => (
                        <div key={index} className="cart-item">
                            <img src={`/assets/${item.image}`} alt={item.name} />
                            <div>
                                <h4>{item.name}</h4>
                                <p>Duration: {item.duration} days</p>
                                <button onClick={() => onRemoveItem(item)}>Remove</button>
                            </div>
                        </div>
                    ))}
                    <button onClick={onCheckout}>Checkout</button>
                </div>
            )}
        </div>
    );
};

export default MyBookingSidebar;
